private static int getIntCookie(String cookie){
  int c;
  if(cookie == null){
    c = 0;
  } else {
    try{
      c = Integer.parseInt(cookie);
    }catch (NumberFormatException e) {
      c = 0;
    }
  }
  c = Math.max(0, c);
  return c;
}
